import React from "react";
import Data from "./Data";

const Card = () => {
  return (
    <>
      <div>
        {Data.map((elem) => {
          let { id, title, desc, imgUrl } = elem;
          return (
            <>
              <div className="card">
              {id}
              <img src="{" alt="" />
              </div>
            </>
          );
        })}
      </div>
    </>
  );
};

export default Card;
